import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import * as serviceWorker from './serviceWorker';
import Whatsapp from './Whatsapp';


// The Message array 

var messages = [
    {
        "source": "sender",
        "message": "Hello",
        "type": "text"
    },
    {
        "source": "receiver",
        "message": 'Thank you for showing interest in "Term Insurance" \
            Please Reply with one of the below options - ',
        "type": "text"
    },
    {
        "source": "receiver",
        "message": "How can we help you?",
        "type": "text"
    },
    {
        "source": "sender",
        "message": "Payslip.pdf",
        "type": "pdf"
    }
]


ReactDOM.render(<Whatsapp messages={messages} />, document.getElementById('root'));

serviceWorker.unregister();
